	//	}
	
		// clear the pressed flags
		up_pressed = false;
		down_pressed = false;
		right_pressed = false;
		left_pressed = false;

		// read the switches
		value = *sw_ptr;

		// which new direction is pressed, set pressed flag, register new directions
		if (VALUE == 0x00000001) {
			up_pressed = true;
			new_direction = 1;
		}
		else if (VALUE == 0x00000002) {
			down_pressed = true;
			new_direction = 2;
		}
		else if (VALUE == 0x00000004) {
			right_pressed = true;
			new_direction = 3;
		}
		else if (VALUE == 0x00000003) {
			left_pressed = true;
			new_direction = 4;
		}
	//	else {
	//		new_direction = 0;
	//	}

		if (previous_direction != new_direction) {
			turned = true;
		} 
		else {
			turned = false;
		}


		/* Erase any boxes and lines that were drawn in the last iteration */
//		clear_screen();		// do this clear screen or redraw prev pattern with black? clear screen is okay :)
		//clear_cube(x_Xs, y_Xs);

			// code for drawing the boxes and lines (not shown) -> initialize the boxes and lines
