void swap(int* a, int* b)
{
	int temp = *a;
	*a = *b;
	*b = temp;
}


void plot_pixel(int x, int y, short int line_color)
{
	*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_cube(int x_center, int y_center)
{
	int size = 5;
	// assuming that boxes will bounce off once they reach the screen (size away from screen)
	// bouncing will be implemented outside of the function
	int x_min = x_center - size;
	int x_max = x_center + size;
	int y_min = y_center - size;
	int y_max = y_center + size;
	int x;
	int y ;
	for (x = x_min; x <= x_max; x++) {
		for (y = y_min; y <= y_max; y++) {
			plot_pixel(x, y, 0x0000);
		}

	}
}

